import React from "react";
import square from "../../images/square.png";
import "./style.css"

function Square(props) {
  const { top, left } = props;

  const style = {
    position: "absolute",
    top: top,
    left: left,
  };

  return (
    <img className="marker" src={square} alt="Area Marker" style={style} />
  );
}

export default Square;
